import React from 'react'

   const Issues = ({ issues }) => {
     return (
       <div>
         <center><h1>Issues</h1></center>
         {issues.map((issue) => (
           <div>
             <div>
               <h5>{issue.Title}</h5>
               <h6>{issue.Description}</h6>
             </div>
           </div>
         ))}
       </div>
     )
   };

   export default Issues
